import React from "react";

const Post = (props) => {
  return (
    <div class="artikel">
      <div class="gamber-artikel">
        <img src="http://placeimg.com/120/120/tech" alt="Gambar Tumbnail Artikel" />
      </div>
      <div class="konten-artikel">
        <div class="judul-artikel">Judul Artikel</div>
        <p class="isi-artikel">Isi Artikel</p>
      </div>
    </div>
  );
};

export default Post;
